let wordPairs = [];
let savedSets = JSON.parse(localStorage.getItem("savedSets") || "[]");
let selectedSet = null;
let currentQuestionIndex = 0;
let currentTestSet = [];
let wrongAnswers = [];

// Base64 সাউন্ড এম্বেড করা হলো (ছোট WAV সাউন্ড)
const correctSoundBase64 = "data:audio/wav;base64,";  // এখানে সম্পূর্ণ base64 বসাও
const incorrectSoundBase64 = "data:audio/wav;base64,";  // এখানে সম্পূর্ণ base64 বসাও

// সাউন্ড অবজেক্ট তৈরি
const correctAudio = new Audio(correctSoundBase64);
const incorrectAudio = new Audio(incorrectSoundBase64);

const englishInput = document.getElementById("englishInput");
const banglaInput = document.getElementById("banglaInput");
const wordList = document.getElementById("wordList");
const setNameInput = document.getElementById("setNameInput");
const saveSetBtn = document.getElementById("saveSetBtn");
const savedSetsDiv = document.getElementById("savedSets");
const modal = document.getElementById("modal");
const modalCloseBtn = document.getElementById("modalCloseBtn");
const modalBody = document.getElementById("modalBody");
const modalSaveBtn = document.getElementById("modalSaveBtn");

// Update displayed word list
function updateWordList() {
  wordList.innerHTML = "";
  wordPairs.forEach(pair => {
    const li = document.createElement("li");
    li.textContent = `${pair.english} - ${pair.bangla}`;
    wordList.appendChild(li);
  });
}

// Save sets to localStorage
function saveToLocalStorage() {
  localStorage.setItem("savedSets", JSON.stringify(savedSets));
}

englishInput.addEventListener("keydown", function (e) {
  if (e.key === "Enter" && englishInput.value.trim()) {
    banglaInput.focus();
  }
});

banglaInput.addEventListener("keydown", function (e) {
  if (e.key === "Enter" && banglaInput.value.trim()) {
    wordPairs.push({ english: englishInput.value.trim(), bangla: banglaInput.value.trim() });
    englishInput.value = "";
    banglaInput.value = "";
    englishInput.focus();
    updateWordList();
  }
});

saveSetBtn.addEventListener("click", () => {
  const setName = setNameInput.value.trim();
  if (!setName || wordPairs.length === 0) return;

  if (savedSets.find(set => set.name.toLowerCase() === setName.toLowerCase())) {
    alert("এই নামের একটি সেট ইতোমধ্যেই রয়েছে।");
    return;
  }

  savedSets.push({ name: setName, words: [...wordPairs] });
  setNameInput.value = "";
  wordPairs = [];
  updateWordList();
  renderSavedSets();
  saveToLocalStorage();
});

function renderSavedSets() {
  savedSetsDiv.innerHTML = "";
  savedSets.forEach((set, index) => {
    const div = document.createElement("div");
    div.className = "set-bar";
    div.innerHTML = `
      <span class="set-name">${set.name}</span>
      <div>
        <button onclick="startTest(${index})">টেস্ট</button>
        <button onclick="openEditModal(${index})"><i class="fas fa-edit"></i></button>
        <button onclick="renameSet(${index})"><i class="fas fa-pen"></i></button>
        <button onclick="deleteSet(${index})"><i class="fas fa-trash"></i></button>
      </div>
    `;
    savedSetsDiv.appendChild(div);
  });
}

function renameSet(index) {
  const newName = prompt("নতুন নাম দিন:", savedSets[index].name);
  if (newName) {
    savedSets[index].name = newName.trim();
    renderSavedSets();
    saveToLocalStorage();
  }
}

function deleteSet(index) {
  if (confirm("আপনি কি এই সেটটি মুছে ফেলতে চান?")) {
    savedSets.splice(index, 1);
    renderSavedSets();
    saveToLocalStorage();
  }
}

function openEditModal(index) {
  selectedSet = index;
  modal.style.display = "flex";
  modalBody.innerHTML = "";
  savedSets[index].words.forEach((pair) => {
    modalBody.innerHTML += `
      <div class="modal-row">
        <input type="text" class="modal-english" value="${pair.english}" />
        <input type="text" class="modal-bangla" value="${pair.bangla}" />
      </div>`;
  });
}

modalCloseBtn.onclick = () => modal.style.display = "none";

modalSaveBtn.onclick = () => {
  const englishInputs = modalBody.querySelectorAll(".modal-english");
  const banglaInputs = modalBody.querySelectorAll(".modal-bangla");
  const updatedWords = [];

  for (let i = 0; i < englishInputs.length; i++) {
    if (englishInputs[i].value.trim() && banglaInputs[i].value.trim()) {
      updatedWords.push({
        english: englishInputs[i].value.trim(),
        bangla: banglaInputs[i].value.trim()
      });
    }
  }

  if (selectedSet !== null) {
    savedSets[selectedSet].words = updatedWords;
    renderSavedSets();
    saveToLocalStorage();
    modal.style.display = "none";
  }
};

// ---------- MCQ Test Functions ----------

function shuffleArray(arr) {
  return arr.sort(() => Math.random() - 0.5);
}

function startTest(index) {
  currentTestSet = shuffleArray([...savedSets[index].words]);
  currentQuestionIndex = 0;
  wrongAnswers = [];

  document.getElementById("mainContainer").style.display = "none";

  const testContainer = document.getElementById("testContainer");
  testContainer.style.display = "block";

  showQuestion();
}

function showQuestion() {
  if (currentQuestionIndex >= currentTestSet.length) {
    return showResult();
  }

  const currentPair = currentTestSet[currentQuestionIndex];
  const isEnglish = Math.random() < 0.5;
  const questionText = isEnglish ? currentPair.english : currentPair.bangla;
  const correctAnswer = isEnglish ? currentPair.bangla : currentPair.english;

  const options = shuffleArray([currentPair, ...getRandomOptions(currentPair)]).map(
    pair => isEnglish ? pair.bangla : pair.english
  );

  document.getElementById("questionBox").innerHTML = `<strong>প্রশ্ন:</strong> ${questionText}`;
  const optionsList = document.getElementById("optionsList");
  optionsList.innerHTML = "";

  options.forEach(optionText => {
    const li = document.createElement("li");
    li.className = "option-button";
    li.textContent = optionText;
    li.onclick = () => handleAnswer(optionText, correctAnswer, li);
    optionsList.appendChild(li);
  });
}

function getRandomOptions(correct) {
  return shuffleArray(currentTestSet.filter(p => p !== correct)).slice(0, 3);
}

function handleAnswer(selected, correct, element) {
  const allOptions = document.querySelectorAll(".option-button");
  allOptions.forEach(opt => {
    opt.onclick = null;
    if (opt.textContent === correct) {
      opt.classList.add("correct");
    } else if (opt.textContent === selected && selected !== correct) {
      opt.classList.add("wrong");
    }
  });

  // সাউন্ড প্লে
  if (selected === correct) {
    correctAudio.currentTime = 0;
    correctAudio.play();
  } else {
    incorrectAudio.currentTime = 0;
    incorrectAudio.play();
  }

  if (selected !== correct) {
    wrongAnswers.push({
      question: document.getElementById("questionBox").textContent,
      correct,
      selected
    });
  }

  setTimeout(() => {
    currentQuestionIndex++;
    showQuestion();
  }, 1000);
}

function showResult() {
  const total = currentTestSet.length;
  const wrong = wrongAnswers.length;
  const correct = total - wrong;
  const percent = ((correct / total) * 100).toFixed(2);

  const resultBox = document.getElementById("resultBox");
  resultBox.innerHTML = `
    <h3>📊 ফলাফল</h3>
    <p>মোট প্রশ্ন: <strong>${total}</strong></p>
    <p>✅ সঠিক: <strong>${correct}</strong></p>
    <p>❌ ভুল: <strong>${wrong}</strong></p>
    <p>🎯 রেজাল্ট: <strong style="font-size: 24px;">${percent}%</strong></p>
    ${
      wrongAnswers.length
        ? `<h4>❌ ভুল প্রশ্নোত্তর:</h4><ul>${wrongAnswers
            .map(w => `<li><strong>${w.question}</strong><br>আপনার উত্তর: <mark>${w.selected}</mark>, সঠিক উত্তর: <mark>${w.correct}</mark></li>`)
            .join("")}</ul>`
        : ""
    }
    <button onclick="restartApp()" style="margin-top:20px;">আবার শুরু করুন</button>
  `;

  document.getElementById("testContainer").style.display = "none";
  document.getElementById("mainContainer").style.display = "block";
}

function restartApp() {
  currentQuestionIndex = 0;
  currentTestSet = [];
  wrongAnswers = [];

  document.getElementById("mainContainer").style.display = "block";
  document.getElementById("testContainer").style.display = "none";

  document.getElementById("resultBox").innerHTML = "";
}

renderSavedSets();
updateWordList();
